import React, { Component } from 'react';
import Link from 'next/link';
import logo from '../static/logo.png';
import search from '../static/search.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardText, CardHeader, CardBody, Button } from 'reactstrap';
import './HeaderStyle/Header.css';

class Header extends Component{

    render(){
        return(

            <div >
                <nav className = 'navbar'>
                    <div className = 'container-fluid'>
                    <Logo/>
                    <SearchBox/>
                    <Menu/>
                    </div>
                </nav>

                <style jsx>{`
                    .navbar{
                        background: #82A3A1;
                    }
                `}</style>
            </div>
        );
    }
}

const Logo = props => (
    <div className = 'navbar-header'>
        <Link href = '#'>
            <a className = 'navbar-brand'>
                        <img src={logo} alt = 'logo'/>
            </a>
        </Link>
        <style jsx>{`
                    img{
                        width: 30px;
                        height: 30px;
                        background: #82A3A1;
                    }

                `}</style>


    </div>
);

const MenuButton = props =>(
    <Link href = {`${props.href}`}>
        <li className = 'nav-item'><a className = 'nav-link'>{`${props.name}`}</a></li>


    </Link>
);

const Menu = props =>(
    <ul className = 'nav'>
        <MenuButton name = 'Main' href = '#'/>
        <MenuButton name = 'Songs' href = '#'/>
        <MenuButton name = 'Compositors' href = '#'/>
        <MenuButton name = 'Chords' href = '#'/>
        <MenuButton name = 'Articles' href = '#'/>

    </ul>


);

const SearchBox = props =>(
    <div className="col-md-6 col-md-offset-3">
        <div className="input-group"> 
            <input type="text" className="form-control" name="x" placeholder="Search term..."/>
            <span className="input-group-btn">
                <button  type="button"><span className="glyphicon glyphicon-search"></span><img src={search} alt = 'search'/></button>
                <style>{`



                `}</style>
            </span>
        </div> 
    </div>

);

export default Header;
